css:
.github-GithubLoginView {
  flex: 1;
  display: flex;
  flex-direction: column;
  font-size: 1.25em;
}
.github-GithubLoginView .github-GithubLoginView-Subview {
  flex: 1;
  display: flex;
  flex-direction: column;
  justify-content: center;
  text-align: center;
  padding: 30px;
}
.github-GithubLoginView .github-GithubLoginView-Subview > * {
  margin: 10px 0;
}
.github-GithubLoginView .github-GithubLoginView-Subview h1 {
  margin-bottom: 30px;
}
.github-GithubLoginView .github-GithubLoginView-Subview button {
  width: 100%;
  overflow: hidden;
  text-overflow: ellipsis;
}
.github-GithubLoginView .github-GithubLoginView-Subview ol {
  text-align: left;
  padding: 10px 0;
}
.github-GithubLoginView .github-GithubLoginView-Subview ol a {
  color: #5293d8;
}
.github-GithubLoginView .github-GithubLoginView-Subview ul {
  list-style: none;
  padding-left: 0;
}
.github-GithubLoginView .github-GithubLoginView-Subview ul li:not(:last-child) {
  margin-bottom: 10px;
}
